            photo10.Hotel = await context.Hotels.Where(X => X.Name == "Ribas Rooms Lutsk").FirstAsync();
            photo10.Name = await imageService.SaveImageAsync("data:image/jpeg;base64,");

            context.HotelPhotos.Add(photo6);
            context.HotelPhotos.Add(photo7);
            context.HotelPhotos.Add(photo8);
            context.HotelPhotos.Add(photo9);
            context.HotelPhotos.Add(photo10);

            context.SaveChanges();
        }
    }
}
